// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./DjedStableCoin.sol";
import "./DjedReserveCoin.sol";
//import "./ExchangeRateOracle.sol";
import "./IPriceOracle.sol";

contract DjedProtocol {
    DjedStableCoin public stableCoin;
    DjedReserveCoin public reserveCoin;

    IPriceOracle oracle;

    // The oracle implementation for this version of Djed
    // returns the USD/ADA exchange rate multiplied by 1e6,
    // thus, multiplication by 1e12 is needed to reach the
    // 18 decimals of milkADA.
    uint256 constant EXCHANGE_RATE_SCALING = 1e12;

    uint256 constant MAX_UINT256 = 2**256 - 1;

    uint256 immutable scalingFactor;
    uint256 immutable scDecimalScalingFactor;
    uint256 immutable rcDecimalScalingFactor;

    // State variable:
    uint256 public reserveBC;

    // System parameters:
    uint256 public immutable reserveRatioMin;
    uint256 public immutable reserveRatioMax;
    uint256 public immutable fee;
    uint256 public immutable thresholdNumberSC;
    uint256 public immutable reserveCoinWholeMinimumPriceBC;

    event BoughtStableCoins(address indexed buyer, uint256 amount);
    event SoldStableCoins(address indexed seller, uint256 amount);
    event BoughtReserveCoins(address indexed buyer, uint256 amount);
    event SoldReserveCoins(address indexed seller, uint256 amount);

    event PriceBuySc(uint256 amountSC, uint256 totalBC);
    event PriceSellSc(uint256 amountSC, uint256 totalBC);
    event PriceBuyRc(uint256 amountRC, uint256 totalBC);
    event PriceSellRc(uint256 amountRC, uint256 totalBC);

    event ReceivedBaseCoins(address indexed sender, uint256 amount);

    constructor(
        uint256 _scalingFactor,
        uint256 _reserveRatioMin,
        uint256 _reserveRatioMax,
        uint256 _fee,
        uint256 _thresholdNumberSC,
        uint256 _reserveCoinWholeMinimumPriceBC,
        address oracleAddress
    ) payable {
        reserveBC = msg.value;
        stableCoin = new DjedStableCoin(address(this));
        reserveCoin = new DjedReserveCoin(address(this));

        scDecimalScalingFactor = uint256(10)**uint256(stableCoin.decimals());
        rcDecimalScalingFactor = uint256(10)**uint256(reserveCoin.decimals());

        oracle = IPriceOracle(oracleAddress);

        scalingFactor = _scalingFactor;
        reserveRatioMin = _reserveRatioMin;
        reserveRatioMax = _reserveRatioMax;
        fee = _fee;
        thresholdNumberSC = _thresholdNumberSC;
        reserveCoinWholeMinimumPriceBC = _reserveCoinWholeMinimumPriceBC;
    }

    receive() external payable {
        reserveBC += msg.value;
        emit ReceivedBaseCoins(msg.sender, msg.value);
    }

    fallback() external payable {
        reserveBC += msg.value;
        emit ReceivedBaseCoins(msg.sender, msg.value);
    }

    /// Public trading API:

    function buyStableCoins() public payable {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 preScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 amountSC = getAmountBuyForPrice(
            msg.value,
            preScWholePriceBC,
            scDecimalScalingFactor
        );
        uint256 totalBC = getPriceBuyN(
            amountSC,
            preScWholePriceBC,
            scDecimalScalingFactor
        );

        uint256 postNumberSC = numberSC + amountSC;
        uint256 postReserveBC = reserveBC + totalBC;
        uint256 postScWholePriceBC = stableCoinWholePriceBC(
            postNumberSC,
            postReserveBC,
            scWholeTargetPriceBC
        );

        requireRatioAboveMin(
            reserveBC,
            numberSC,
            preScWholePriceBC,
            "SC buy precondition does not hold"
        );
        requireRatioAboveMin(
            postReserveBC,
            postNumberSC,
            postScWholePriceBC,
            "SC buy postcondition does not hold"
        );

        // The following should always hold assuming the prices are calculated correctly:
        assert(msg.value >= totalBC);

        reserveBC += totalBC;
        stableCoin.mint(msg.sender, amountSC);
        emit BoughtStableCoins(msg.sender, amountSC);
    }

    function sellStableCoins(uint256 amountSC) public payable {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 scWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        uint256 totalBC = getPriceSellN(
            amountSC,
            scWholePriceBC,
            scDecimalScalingFactor
        );

        require(
            stableCoin.balanceOf(msg.sender) >= amountSC,
            "Seller has too few SCs"
        );
        require(reserveBC >= totalBC, "Not enough BCs in reserve");

        reserveBC -= totalBC;
        stableCoin.burn(msg.sender, amountSC);
        payable(msg.sender).transfer(totalBC);
        emit SoldStableCoins(msg.sender, amountSC);
    }

    function buyReserveCoins() public payable {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 numberRC = reserveCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 rcWholePriceBC = reserveCoinWholeBuyPriceBC(
            numberRC,
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 amountRC = getAmountBuyForPrice(
            msg.value,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        uint256 totalBC = getPriceBuyN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );

        if (numberSC >= thresholdNumberSC) {
            uint256 preScWholePriceBC = stableCoinWholePriceBC(
                numberSC,
                reserveBC,
                scWholeTargetPriceBC
            );
            uint256 postReserveBC = reserveBC + totalBC;
            uint256 postScWholePriceBC = stableCoinWholePriceBC(
                numberSC,
                postReserveBC,
                scWholeTargetPriceBC
            );

            requireRatioBelowMax(
                reserveBC,
                numberSC,
                preScWholePriceBC,
                "RC buy precondition does not hold"
            );
            requireRatioBelowMax(
                postReserveBC,
                numberSC,
                postScWholePriceBC,
                "RC buy postcondition does not hold"
            );
        }

        //require(msg.value >= totalBC, "Supplied value not equal to expected");
        // The following should always hold assuming the prices are calculated correctly:
        assert(msg.value >= totalBC);

        reserveBC += totalBC;
        reserveCoin.mint(msg.sender, amountRC);
        emit BoughtReserveCoins(msg.sender, amountRC);
    }

    function sellReserveCoins(uint256 amountRC) public payable {
        require(
            reserveCoin.balanceOf(msg.sender) >= amountRC,
            "Seller has too few RCs"
        );
        uint256 numberSC = stableCoin.totalSupply();
        uint256 numberRC = reserveCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 rcWholePriceBC = reserveCoinWholeTargetPriceBC(
            numberRC,
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 totalBC = getPriceSellN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        uint256 preScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 postReserveBC = reserveBC - totalBC;
        uint256 postScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            postReserveBC,
            scWholeTargetPriceBC
        );

        requireRatioAboveMin(
            reserveBC,
            numberSC,
            preScWholePriceBC,
            "RC sell precondition does not hold"
        );
        requireRatioAboveMin(
            postReserveBC,
            numberSC,
            postScWholePriceBC,
            "RC sell postcondition does not hold"
        );

        require(reserveBC >= totalBC, "Not enough BCs in reserve");

        reserveBC -= totalBC;
        reserveCoin.burn(msg.sender, amountRC);
        payable(msg.sender).transfer(totalBC);
        emit SoldReserveCoins(msg.sender, amountRC);
    }

    /// Public informative API

    function getStableCoinWholeTargetPriceBC() public returns (uint256) {
        return stableCoinWholeTargetPriceBC();
    }

    function getReserveCoinWholeBuyPriceBC() public returns (uint256) {
        return
            reserveCoinWholeBuyPriceBC(
                reserveCoin.totalSupply(),
                stableCoin.totalSupply(),
                reserveBC,
                stableCoinWholeTargetPriceBC()
            );
    }

    function getReserveCoinWholeSellPriceBC() public returns (uint256) {
        uint256 numberRC = reserveCoin.totalSupply();
        if (numberRC == 0) {
            return 0;
        }
        return
            reserveCoinWholeTargetPriceBC(
                numberRC,
                stableCoin.totalSupply(),
                reserveBC,
                stableCoinWholeTargetPriceBC()
            );
    }

    function checkBuyableNStableCoins(uint256 amountSC) public returns (bool) {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 scWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );

        // Precondition check:
        if (!isRatioAboveMin(reserveBC, numberSC, scWholePriceBC)) {
            return false;
        }

        uint256 totalBC = getPriceBuyN(
            amountSC,
            scWholePriceBC,
            scDecimalScalingFactor
        );
        uint256 postNumberSC = numberSC + amountSC;
        uint256 postReserveBC = reserveBC + totalBC;
        uint256 postScWholePriceBC = stableCoinWholePriceBC(
            postNumberSC,
            postReserveBC,
            scWholeTargetPriceBC
        );

        // Postcondition check:
        return isRatioAboveMin(postReserveBC, postNumberSC, postScWholePriceBC);
    }

    function checkBuyableNReserveCoins(uint256 amountRC) public returns (bool) {
        uint256 numberSC = stableCoin.totalSupply();
        if (numberSC < thresholdNumberSC) {
            return true;
        }

        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 preScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );

        // Precondition check:
        if (!isRatioBelowMax(reserveBC, numberSC, preScWholePriceBC)) {
            return false;
        }

        uint256 rcWholePriceBC = reserveCoinWholeBuyPriceBC(
            reserveCoin.totalSupply(),
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 totalBC = getPriceBuyN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        uint256 postReserveBC = reserveBC + totalBC;
        uint256 postScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            postReserveBC,
            scWholeTargetPriceBC
        );

        // Postcondition check:
        return isRatioBelowMax(postReserveBC, numberSC, postScWholePriceBC);
    }

    function checkSellableNReserveCoins(uint256 amountRC)
        public
        returns (bool)
    {
        uint256 numberSC = stableCoin.totalSupply();

        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 preScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );

        // Precondition check:
        if (!isRatioAboveMin(reserveBC, numberSC, preScWholePriceBC)) {
            return false;
        }

        uint256 rcWholePriceBC = reserveCoinWholeBuyPriceBC(
            reserveCoin.totalSupply(),
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );
        uint256 totalBC = getPriceBuyN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        // The following should never happen due to how Djed works,
        // but the code allows it in principle.
        require(reserveBC >= totalBC, "Insufficient reserves");
        uint256 postReserveBC = reserveBC - totalBC;
        uint256 postScWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            postReserveBC,
            scWholeTargetPriceBC
        );

        // Postcondition check:
        return isRatioAboveMin(postReserveBC, numberSC, postScWholePriceBC);
    }

    // NOTE: only Djed conditions are checked, not account balances
    function getMaxBuyableStableCoins() public returns (uint256) {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        if (
            (scWholeTargetPriceBC * numberSC) >
            (reserveBC * scDecimalScalingFactor)
        ) {
            return 0;
        }
        uint256 scaledReserves = reserveBC *
            scalingFactor *
            scDecimalScalingFactor;
        uint256 liabilitiesRmin = numberSC *
            scWholeTargetPriceBC *
            reserveRatioMin;
        if (scaledReserves <= liabilitiesRmin) {
            return 0;
        }

        return
            (scaledReserves - liabilitiesRmin) /
            (scWholeTargetPriceBC * (reserveRatioMin - scalingFactor - fee));
    }

    // NOTE: only Djed conditions are checked, not account balances
    function getMaxBuyableReserveCoins() public returns (uint256) {
        uint256 numberSC = stableCoin.totalSupply();
        if (numberSC < thresholdNumberSC) {
            return MAX_UINT256;
        }

        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        uint256 scaledReserves = reserveBC *
            scalingFactor *
            scDecimalScalingFactor;
        uint256 liabilitiesRmax = numberSC *
            scWholeTargetPriceBC *
            reserveRatioMax;
        if (scaledReserves >= liabilitiesRmax) {
            return 0;
        }

        uint256 numberRC = reserveCoin.totalSupply();
        uint256 rcWholeBuyPriceBC = reserveCoinWholeBuyPriceBC(
            numberRC,
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );

        return
            ((liabilitiesRmax - scaledReserves) * rcDecimalScalingFactor) /
            (rcWholeBuyPriceBC *
                (scalingFactor + fee) *
                scDecimalScalingFactor);
    }

    // NOTE: only Djed conditions are checked, not account balances
    function getMaxSellableReserveCoins() public returns (uint256) {
        uint256 numberSC = stableCoin.totalSupply();
        uint256 scWholeTargetPriceBC = stableCoinWholeTargetPriceBC();
        if (
            (scWholeTargetPriceBC * numberSC) >
            (reserveBC * scDecimalScalingFactor)
        ) {
            return 0;
        }
        uint256 scaledReserves = reserveBC *
            scalingFactor *
            scDecimalScalingFactor;
        uint256 liabilitiesRmin = numberSC *
            scWholeTargetPriceBC *
            reserveRatioMin;
        if (scaledReserves <= liabilitiesRmin) {
            return 0;
        }

        uint256 numberRC = reserveCoin.totalSupply();
        uint256 rcWholeBuyPriceBC = reserveCoinWholeBuyPriceBC(
            numberRC,
            numberSC,
            reserveBC,
            scWholeTargetPriceBC
        );

        return
            ((scaledReserves - liabilitiesRmin) * rcDecimalScalingFactor) /
            (rcWholeBuyPriceBC *
                (scalingFactor - fee) *
                scDecimalScalingFactor);
    }

    function getPriceBuyNStableCoinsBC(uint256 amountSC)
        public
        returns (uint256)
    {
        uint256 scWholePriceBC = stableCoinWholePriceBC(
            stableCoin.totalSupply(),
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        uint256 totalBC = getPriceBuyN(
            amountSC,
            scWholePriceBC,
            scDecimalScalingFactor
        );
        emit PriceBuySc(amountSC, totalBC);
        return totalBC;
    }

    function getPriceSellNStableCoinsBC(uint256 amountSC)
        public
        returns (uint256)
    {
        uint256 scWholePriceBC = stableCoinWholePriceBC(
            stableCoin.totalSupply(),
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        uint256 totalBC = getPriceSellN(
            amountSC,
            scWholePriceBC,
            scDecimalScalingFactor
        );
        emit PriceSellSc(amountSC, totalBC);
        return totalBC;
    }

    function getPriceBuyNReserveCoinsBC(uint256 amountRC)
        public
        returns (uint256)
    {
        uint256 rcWholePriceBC = reserveCoinWholeBuyPriceBC(
            reserveCoin.totalSupply(),
            stableCoin.totalSupply(),
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        uint256 totalBC = getPriceBuyN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        emit PriceBuyRc(amountRC, totalBC);
        return totalBC;
    }

    function getPriceSellNReserveCoinsBC(uint256 amountRC)
        public
        returns (uint256)
    {
        uint256 numberRC = reserveCoin.totalSupply();
        require(numberRC > 0, "No RCs in circulation, undefined price");
        uint256 rcWholePriceBC = reserveCoinWholeTargetPriceBC(
            numberRC,
            stableCoin.totalSupply(),
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        uint256 totalBC = getPriceSellN(
            amountRC,
            rcWholePriceBC,
            rcDecimalScalingFactor
        );
        emit PriceSellRc(amountRC, totalBC);
        return totalBC;
    }

    function getReserveRatio() public returns (uint256) {
        uint256 numberSC = stableCoin.totalSupply();
        if (numberSC == 0) {
            return 0;
        }
        uint256 scWholePriceBC = stableCoinWholePriceBC(
            numberSC,
            reserveBC,
            stableCoinWholeTargetPriceBC()
        );
        return
            (reserveBC * scalingFactor * scDecimalScalingFactor) /
            (scWholePriceBC * numberSC);
    }

    /// Internal utils:

    function requireRatioAboveMin(
        uint256 _reserveBC,
        uint256 _numberSC,
        uint256 _priceScWholeBC,
        string memory errMsg
    ) internal view {
        require(
            isRatioAboveMin(_reserveBC, _numberSC, _priceScWholeBC),
            errMsg
        );
    }

    function requireRatioBelowMax(
        uint256 _reserveBC,
        uint256 _numberSC,
        uint256 _priceScWholeBC,
        string memory errMsg
    ) internal view {
        require(
            isRatioBelowMax(_reserveBC, _numberSC, _priceScWholeBC),
            errMsg
        );
    }

    /// Internal calculations:

    function getPriceBuyN(
        uint256 amount,
        uint256 unitWholePrice,
        uint256 decimalScalingFactor
    ) internal view returns (uint256) {
        return
            (amount * (scalingFactor + fee) * unitWholePrice) /
            (scalingFactor * decimalScalingFactor);
    }

    function getPriceSellN(
        uint256 amount,
        uint256 unitWholePrice,
        uint256 decimalScalingFactor
    ) internal view returns (uint256) {
        return
            (amount * (scalingFactor - fee) * unitWholePrice) /
            (scalingFactor * decimalScalingFactor);
    }

    function getAmountBuyForPrice(
        uint256 totalBC,
        uint256 unitWholePrice,
        uint256 decimalScalingFactor
    ) internal view returns (uint256) {
        return
            (totalBC * scalingFactor * decimalScalingFactor) /
            ((scalingFactor + fee) * unitWholePrice);
    }

    function stableCoinWholeTargetPriceBC() internal returns (uint256) {
        return uint256(oracle.exchangeRate()) * EXCHANGE_RATE_SCALING;
    }

    function stableCoinWholePriceBC(
        uint256 numberSC,
        uint256 _reserveBC,
        uint256 scWholeTargetPriceBC
    ) internal view returns (uint256) {
        if (numberSC == 0) {
            return scWholeTargetPriceBC;
        }

        uint256 reservePerWholeScBC = (_reserveBC * scDecimalScalingFactor) /
            numberSC;

        if (reservePerWholeScBC >= scWholeTargetPriceBC) {
            return scWholeTargetPriceBC;
        } else {
            return reservePerWholeScBC;
        }
    }

    function reserveCoinWholeTargetPriceBC(
        uint256 numberRC,
        uint256 numberSC,
        uint256 _reserveBC,
        uint256 scWholeTargetPriceBC
    ) internal view returns (uint256) {
        assert(numberRC != 0);
        return
            ((_reserveBC *
                scDecimalScalingFactor -
                numberSC *
                stableCoinWholePriceBC(
                    numberSC,
                    _reserveBC,
                    scWholeTargetPriceBC
                )) * rcDecimalScalingFactor) /
            (numberRC * scDecimalScalingFactor);
    }

    function reserveCoinWholeBuyPriceBC(
        uint256 numberRC,
        uint256 numberSC,
        uint256 _reserveBC,
        uint256 scWholeTargetPriceBC
    ) internal view returns (uint256) {
        if (numberRC == 0) {
            return reserveCoinWholeMinimumPriceBC;
        }

        uint256 rcWholeTargetPriceBC = reserveCoinWholeTargetPriceBC(
            numberRC,
            numberSC,
            _reserveBC,
            scWholeTargetPriceBC
        );
        if (rcWholeTargetPriceBC <= reserveCoinWholeMinimumPriceBC) {
            return reserveCoinWholeMinimumPriceBC;
        } else {
            return rcWholeTargetPriceBC;
        }
    }

    function isRatioAboveMin(
        uint256 _reserveBC,
        uint256 _numberSC,
        uint256 _priceScWholeBC
    ) internal view returns (bool) {
        return
            _reserveBC * scalingFactor * scDecimalScalingFactor >=
            _numberSC * _priceScWholeBC * reserveRatioMin;
    }

    function isRatioBelowMax(
        uint256 _reserveBC,
        uint256 _numberSC,
        uint256 _priceScWholeBC
    ) internal view returns (bool) {
        return
            _reserveBC * scalingFactor * scDecimalScalingFactor <=
            _numberSC * _priceScWholeBC * reserveRatioMax;
    }
}
